import Link from "next/link";
import Layout from "../components/Layout";

export default () => (
  <Layout title="WINE手帳">
    <nav>
      <ul>
        <li>TOP</li>
        <li>CONCEPT</li>
        <li>CONTACT</li>
      </ul>
    </nav>
    <Link href="./other">
      <button>go to Other page</button>
    </Link>
  </Layout>
);
